import './App.css';
import Habits from './components/habits.jsx';
import React, { useState } from 'react';

const App = props => {

  const initialHabits = [
    new habitGenerator('Running'),
    new habitGenerator('Eating'),
    new habitGenerator('Reading'),
  ]

  function habitGenerator(habit) {
    this.id = Date.now();
    this.habit = habit;
    this.count = 0;
  }

  const [ habits, setHabits ] = useState(initialHabits);

  const handleChange = () => {
    setHabits('Eating')
  };

  return ( 
    <>
      <Habits 
      onChange={handleChange}
      habits={habits}
      />
    </>
  )

};

export default App;
